function renderCeps() {
  listElement.innerHTML = '';

  for (cep of ceps) {
    const liElement = document.createElement('li');
    const cepNome = document.createTextNode(cep.nome);

    liElement.appendChild(cepNome);
    listElement.appendChild(liElement);
  }
}

renderCeps();

function limparCampos() {
  // document.getElementById('formCep').reset();
  document.getElementById('nome').value = '';
  document.getElementById('cep').value = '';
  document.getElementById('logradouro').value = '';
  document.getElementById('numero').value = '';
  document.getElementById('complemento').value = '';
  document.getElementById('bairro').value = '';
  document.getElementById('localidade').value = '';
  document.getElementById('uf').value = '';
}

async function addCep(e) {
  const codeBar = document.getElementById('cep').value;

  var barcode = new bytescoutbarcode128();
  barcode.valueSet(codeBar);
  barcode.setMargins(5, 5, 5, 5);
  barcode.setBarWidth(2);
  var width = barcode.getMinWidth();
  barcode.setSize(width, 100);
  const imgCodeBar = barcode.exportToBase64(width, 100, 0);

  c = {
    nome: document.getElementById('nome').value,
    cep: codeBar,
    logradouro: document.getElementById('logradouro').value,
    numero: document.getElementById('numero').value,
    complemento: document.getElementById('complemento').value,
    bairro: document.getElementById('bairro').value,
    localidade: document.getElementById('localidade').value,
    uf: document.getElementById('uf').value,
    barCode: imgCodeBar,
  };
  ceps.push(c);
  limparCampos();
  renderCeps();
  localStorage.setItem('ceps', JSON.stringify(ceps));
  e.preventDefault();
}

